import scrapy
import time


class HotelsSpider(scrapy.Spider):
    name = 'hotels'
    allowed_domains = ['hotels.ctrip.com']
    start_urls = ['https://hotels.ctrip.com/hotel/guangzhou32#ctm_ref=hod_hp_sb_lst']
    page_num = 0

    def parse(self, response):
        url = 'https://hotels.ctrip.com/Domestic/Tool/AjaxHotelList.aspx'

        if self.page_num <= 0:
            self.page_num = response.css('#page_info .layoutfix a:last-child::text').get()
            for i in range(self.page_num):
                k = i + 1
                param = self.form_data(k)
                scrapy.FormRequest(url=url, callback=self.post_parse, formdata=param)
                time.sleep(0.5)
                if i >= 1:
                    break
        # res = scrapy.Request(url=url, method='POST', body={})

